// frontend/src/pages/dashboard.jsx
import React, { useEffect, useState } from "react";
import { fetchJobs, logout } from "../api";
import { Link, useNavigate } from "react-router-dom";

export default function Dashboard() {
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    if (!token) {
      navigate("/login");
      return;
    }

    (async () => {
      setLoading(true);
      setErr("");
      try {
        const data = await fetchJobs();
        // data.jobs should be an array (backend normalized)
        const j = Array.isArray(data.jobs) ? data.jobs : (data.jobs?.result?.jobList || []);
        setJobs(j);
      } catch (e) {
        console.error(e);
        setErr("Failed to load jobs. Please try again.");
      } finally {
        setLoading(false);
      }
    })();
  }, [navigate]);

  function handleLogout() {
    logout();
    navigate("/login");
  }

  return (
    <div style={{ padding: 20 }}>
      <header style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h2>Recommended Jobs</h2>
        <nav>
          <Link to="/profile" style={{ marginRight: 12 }}>Profile</Link>
          <button onClick={handleLogout}>Logout</button>
        </nav>
      </header>

      <main style={{ marginTop: 20 }}>
        {loading && <p>Loading jobs…</p>}
        {!loading && err && <p style={{ color: "red" }}>{err}</p>}
        {!loading && !err && jobs.length === 0 && <p>No matching jobs found.</p>}

        {!loading && Array.isArray(jobs) && jobs.map((job, idx) => (
          <div key={idx} className="job-card" style={{ padding: 12, border: "1px solid #ddd", marginBottom: 10 }}>
            <h3 style={{ margin: 0 }}>{job.title || job.jobTitle || "Untitled role"}</h3>
            <p style={{ margin: "6px 0" }}>
              <strong>{job.company || job.companyName}</strong> — {job.location || job.jobLocation || "Location unknown"}
            </p>
            <p style={{ margin: "6px 0" }}>{job.posted || job.publishTimeDesc || job.postDate}</p>
            {job.summary && <p style={{ margin: "6px 0" }}>{job.summary}</p>}
            {job.url ? (
              <a href={job.url} target="_blank" rel="noopener noreferrer">Apply</a>
            ) : job.applyLink ? (
              <a href={job.applyLink} target="_blank" rel="noopener noreferrer">Apply</a>
            ) : (
              <span>No link</span>
            )}
          </div>
        ))}
      </main>
    </div>
  );
}
